import Navbar from './components/Navbar';
import Card from './components/Card';
// import './App.css';
import './styles/base.css';
import { useState } from 'react';

function App() {

  const [input, setInput] = useState({botname: "", chipnum: ""});
  const [names, setNames] = useState([]);

  return (
    <div className="App">
      <header className="App-header">
      </header>
      <Navbar></Navbar>
      <Card input={input} setInput={setInput} names={names} setNames={setNames}></Card>

    </div>
  );
}

export default App;
